import React from "react";
import { Card, Image, Label } from "semantic-ui-react";

export default function Category({ props }) {
  console.log(props);

  const cat = props ? (<div>
    <Card>
      <Image src={props.category.picture} wrapped ui={false} />
      <Card.Content>
        <Card.Header>{props.category.name}</Card.Header>
      </Card.Content>
      <Card.Content extra>
        <Label as="a" color="teal" image>
          <img src="https://react.semantic-ui.com/images/avatar/small/jenny.jpg" />
          Veronika
            <Label.Detail>Parent</Label.Detail>
        </Label>
      </Card.Content>
    </Card>
  </div>) : <h1>Theres is nothing</h1>;

  return cat;
}
